class Solution(object):
    def minKBitFlips(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        L = len(nums)
        idx = 0
        ans = 0
        while idx < L:
            if nums[idx] == 0:
                if idx > L - k:
                    return -1
                ans += 1
                for x in range(k):
                    nums[idx + x] = 1 - nums[idx + x]
            idx += 1
        return ans


